import React, { Component } from 'react'
import "./SearchForm.css";

class SearchForm extends Component {
    render() {
        return (
            <section className="SearchForm">
                <h2>Curiosity</h2>
                <form>
                    <div>
                        <label></label>
                        <input type="text" />
                    </div>
                    <div>
                        <label></label>
                        <select></select>
                    </div>
                    <input className="SearchForm-sbutton" type="submit" value="Find Photos" />
                </form>
            </section>
        );
    }
}


export default SearchForm;
